class TrieNode:
    def __init__(self):
        self.children = {}
        self.is_end_of_word = False

class Trie:
    def __init__(self):
        self.root = TrieNode()

    def insert(self, word):
        node = self.root
        for char in word:
            if char not in node.children:
                node.children[char] = TrieNode()
            node = node.children[char]
        node.is_end_of_word = True

    def find(self, word):
        node = self.root
        for char in word:
            if char not in node.children:
                return False
            node = node.children[char]
        return node.is_end_of_word

def main():
    trie = Trie()
    n = int(input())
    for _ in range(n):
        line = input().split()
        if line[0] == 'insert':
            trie.insert(line[1])
        elif line[0] == 'find':
            print('yes' if trie.find(line[1]) else 'no')

if __name__ == "__main__":
